import React from "react";
import { Row, Col, Card } from "antd";

/* @custom component ------------------------------------------------------------------------------------------- */

    import Header from "../../component/Header/Header";
    import { PageContainer } from "../../component/Xcomponent";

/* ------------------------------------------------------------------------------------------------------------- */

const Home = (props) => {
  return (
    <React.Fragment>
      <Header />
      <PageContainer>
        <div
          className="site-card-wrapper dashboard-fieldset"
        >
          <h3 className="dashboard-fieldset-heading"
          >
            <b>Dashboard</b>
          </h3>
          <Row gutter={16}>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
          </Row>
        </div>
      </PageContainer>
    </React.Fragment>
  );
};

export default Home;
